static int i2c_write_byte(struct i2c_client *client, u8 addr, u8 reg, u8 val)
{
	int rc = 0;
	struct i2c_msg msg;
	u8 buf[2] = { reg, val };

	if (!client) {
		pr_err("%s: Invalid params\n", __func__);
		return -EINVAL;
	}

	//printk("%s: [%s:0x%02x] : W[0x%02x, 0x%02x]\n", __func__,
	//       client->name, addr, reg, val);

	client->addr = addr;
	msg.addr = addr;
	msg.flags = 0;
	msg.len = 2;
	msg.buf = buf;

	if (i2c_transfer(client->adapter, &msg, 1) < 1) {
		pr_err("%s: i2c write failed\n", __func__);
		rc = -EIO;
	}
	return rc;
}

static int i2c_read(struct i2c_client *client, u8 addr, u8 reg, char *buf, u32 size)
{
	int rc = 0;
	struct i2c_msg msg[2];

	if (!client || !buf) {
		pr_err("%s: Invalid params\n", __func__);
		return -EINVAL;
	}

	client->addr = addr;

	msg[0].addr = addr;
	msg[0].flags = 0;
	msg[0].len = 1;
	msg[0].buf = &reg;

	msg[1].addr = addr;
	msg[1].flags = I2C_M_RD;
	msg[1].len = size;
	msg[1].buf = buf;

	if (i2c_transfer(client->adapter, msg, 2) != 2) {
		pr_err("%s: i2c read failed\n", __func__);
		rc = -EIO;
	}

	//printk("%s: [%s:0x%x] : R[0x%02x, 0x%02x]\n", __func__,
	//       client->name, addr, reg, *buf);
	return rc;
}

static int lt9611_read(struct lt9611 *pdata, u8 reg, char *buf, u32 size)
{
	u8 addr = 0;
	int ret = 0;

	if (!pdata) {
		pr_err("Invalid argument\n");
		return -EINVAL;
	}

	addr = pdata->i2c_addr;
	ret = i2c_read(pdata->i2c_client, addr, reg, buf, size);
	if (ret)
		pr_err("%s: read err: addr 0x%x, reg 0x%x, size 0x%x\n", __func__, addr, reg, size);
	return ret;
}

static int lt9611_write(struct lt9611 *pdata, u8 reg, u8 val)
{
	u8 addr = 0;
	int ret = 0;

	if (!pdata) {
		pr_err("Invalid argument\n");
		return -EINVAL;
	}

	addr = pdata->i2c_addr;
	ret = i2c_write_byte(pdata->i2c_client, addr, reg, val);
	if (ret)
		pr_err("%s: wr err: addr 0x%x, reg 0x%x, val 0x%x\n", __func__, addr, reg, val);
	return ret;
}
