static void LT2611UX_Config(struct lt9611 *pdata)
{
    lt9611_write(pdata, 0xff,0x80);
    lt9611_write(pdata, 0xee,0x01);
    lt9611_write(pdata, 0x5e,0xdf);
    lt9611_write(pdata, 0x58,0x00);
    lt9611_write(pdata, 0x59,0x50);
    lt9611_write(pdata, 0x5a,0x10);
    lt9611_write(pdata, 0x5a,0x00);
}

static void LT2611UX_BlockErase(struct lt9611 *pdata)
{
    lt9611_write(pdata,0xff,0x80);
    lt9611_write(pdata,0x5a,0x04);
    lt9611_write(pdata,0x5a,0x00);
    lt9611_write(pdata,0x5b,0x00);  //addr
    lt9611_write(pdata,0x5c,0x00);  //addr
    lt9611_write(pdata,0x5d,0x00);  //addr
    lt9611_write(pdata,0x5a,0x01);
    lt9611_write(pdata,0x5a,0x00);
}

static void LT2611UX_WriteEnable(struct lt9611 *pdata)
{
    lt9611_write(pdata,0xff,0x81);
    lt9611_write(pdata,0x08,0xbf);
    msleep(10);
    lt9611_write(pdata,0x08,0xff);
    msleep(10);
    
    lt9611_write(pdata,0xff,0x80);
    lt9611_write(pdata,0x5a,0x04);
    lt9611_write(pdata,0x5a,0x00); 
}

static void LT2611UX_WriteData(u8 *pfile, u16 filesize,struct lt9611 *pdata)
{
    u16 page = 0;
    u32 addr = 0;
    u32 i = 0;
    u32 num = 0;
    
    page = (filesize % PAGE_SIZE_9611) ? ((filesize / PAGE_SIZE_9611) + 1) : (filesize / PAGE_SIZE_9611);
    if(page*PAGE_SIZE_9611 > 24*1024)   //more than 24K, return
    {
        printk("\nFile size is out of range!");
        return;
    }
    
    printk("page = %d\n",page);
    printk("filesize = %d\n",filesize);
    
    for(num=0;num<page;num++)
    {
        LT2611UX_WriteEnable(pdata);
        
        lt9611_write(pdata,0xff,0x80);
        lt9611_write(pdata,0x5e,0xdf);
        lt9611_write(pdata,0x5a,0x20);
        lt9611_write(pdata,0x5a,0x00);
        lt9611_write(pdata,0x58,0x21);
        
        //write data to fifo
        for(i=0;i<PAGE_SIZE_9611;i++)
        {
            if((num*PAGE_SIZE_9611 + i) < filesize)
            {
                lt9611_write(pdata,0x59,*(pfile+i+num*PAGE_SIZE_9611));  //data
                
            }
            else
            {
                lt9611_write(pdata,0x59, 0xFF);  //data
            }
            //msleep(1);
        }
        
        lt9611_write(pdata,0x5b,((addr & 0xFF0000) >> 16) );  //addr[23:16]
        lt9611_write(pdata,0x5c,((addr & 0xFF00) >> 8));  //addr[15:8]
        lt9611_write(pdata,0x5d,(addr & 0xFF));  //addr[7:0]
        lt9611_write(pdata,0x5a,0x10);
        lt9611_write(pdata,0x5a,0x00);
        
        addr += PAGE_SIZE_9611;
    }
}
